import React from "react";
import './Fifth.css';

function App() {

  return (
<div className="Fifthm">
    <div className="Fifthmbox">
    <div className="ab" id="mhs">
        <div className="dp"><a className="adp" href="/#t"><img src={require("./mhsirdp.jpeg")} id="pic" alt="pic" /></a></div>
        <div className="info">Mahendra Chouhan Singh</div>
    </div>
    <div className="ab" id="nim">
        <div className="dp"><a className="adp" href="/#t"><img src={require("./mee.png")} id="pic" alt="pic" /></a></div>
        <div className="info">  Nimit Jain</div>
        <div className="wrapper">
        <ul><li class="github"><a href="https://github.com/Nimitzzz"><i class="fa fa-github fa-2x" aria-hidden="true"></i></a></li></ul>
        </div>
    </div>
    <div className="ab" id="arp">
        <div className="dp"><a className="adp" href="/#t"><img src={require("./arpitdp.png")} id="pic" alt="pic" /></a></div>
        <div className="info">Arpit Dwivedi</div>
    </div>
    </div>
</div>

  );
}

export default App;
